import React from 'react';

const TitleStyle = {
  paddingBottom: '20px'
};

const Title = () => {
  return(
    <div className="ui two column doubling stackable grid container" style={TitleStyle}>
      <div className="column">
        <h3>TODO</h3>
      </div>
      <div className="column">
        <button className="ui button right floated">Create</button>
      </div>
    </div>
  );
};

export default Title;
